import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Page1 from "./pages/page1"; 
import Page2 from "./pages/page2"; // Import Page2 instead of page2

function App() {
  return (
    <div style = {{backgroundImage: 'url(/images/theme.jpg)'}}>
    <Router>
      <Routes>
        <Route exact path="/" element={<Page1 />} />
        <Route path="/page2" element={<Page2 />} /> {/* Update the path */}
      </Routes>
    </Router>
    </div>
  );
}

export default App;
